#!/usr/bin/env python3 
dna=""
A_count=dna.count("A")
T_count=dna.count("T")
AT_total=A_count+T_count
dna_length=len(dna)
AT_content=AT_total/len(dna)
AT_content_percent="{:.2%}".format(AT_content)
GC_content=1-AT_content
GC_content_percent="{:.2%}".format(GC_content)
print("The A-T content of this DNA sequence is:" , AT_content_percent , '\n' , "The G-C content of this DNA sequence is:" , GC_content_percent)


